import React from 'react';
import Group from './Group'

class MyGroup extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
          isLoading: false,
          username : 'winisgod',
          groupList : ['g1','g2','g3','g4','g5','g6','g7','g8'],
        }
    }

    componentDidMount(){

    }

    render() {
        return (
          <div>
              <div>My Groups</div>
              <div>
                {
                    this.props.groupList.map(group =>{
                        return <Group  username={this.state.username} group={group}/>;
                    })
                }
              </div>
          </div>
        );
    }
}

export default MyGroup;
